import { services } from '../../data';

const SugarServices = () => {
  return (
    <div className="">
      {services.map((service, index) => (
        <div key={index} className="flex justify-around">
          <p>{service.serviceName}</p>
          <p>${service.price}</p>
        </div>
      ))}
    </div>
  );
};

export default SugarServices;
